import React from 'react';
import {Link} from '../routes';

const Headers =()=>{
   return <div class="ui menu" style={{marginTop:'20px'}}>
 <Link><a class="item">CrowdCoins</a></Link> 
  
  <div class="right menu">
    <a class="item">Campaigns</a>
    <a class="item">+</a>
  </div>
</div>
}
export default Headers;
